За даними Міноборони, за три дні російського вторгнення в Україну:
 • загинуло понад 210 мирних жителів, з них шестеро дітей;
 • поранено або постраждали понад 1100 осіб, з них понад 100 дітей;
 • зруйновано об'єкти цивільної інфраструктури – понад 350 (житлові будинки, укриття, магазини, медичні установи, мости, навчальні заклади).
З 25 лютого відзначається збільшення кількості випадків обстрілу закладів медичної та освітньої сфер.

